// src/pages/LoginPage.jsx
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../styles/LoginPage.css"; // optional if you have a login stylesheet

export default function LoginPage() {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function onSubmit(e) {
    e.preventDefault();
    // TODO: replace with real auth call
    const ok = email && password; // dummy
    if (ok) {
      localStorage.setItem("auth", "true");
      navigate("/dataset", { replace: true });
    }
  }

  return (
    <div className="login-page">
      <div className="login-card">
        <header className="login-head">
          <h1 className="login-title">Sign in</h1>
          <p className="login-sub">Access the VRU Radar Micro-Doppler dataset</p>
        </header>

        <form className="login-form" onSubmit={onSubmit}>
          <label className="field">
            <span className="field-label">Email</span>
            <input
              className="input"
              type="email"
              autoComplete="email"
              placeholder="you@institution.edu"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </label>

          <label className="field">
            <span className="field-label">Password</span>
            <input
              className="input"
              type="password"
              autoComplete="current-password"
              placeholder="••••••••"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </label>

          <div className="actions">
            <button type="submit" className="btn btn-aurora btn-purple">
              Sign In
            </button>

            {/* This is the button that routes to CreateAccount.jsx */}
            <Link
              to="/create-account"
              className="btn btn-aurora btn-outline"
              aria-label="Create a new account"
              title="Create a new account"
            >
              Create Account
            </Link>
          </div>
        </form>

        <footer className="login-footer">
          <Link className="link-muted" to="/reset">
            Forgot password?
          </Link>
        </footer>
      </div>
    </div>
  );
}
